               ]
             }
   }

    render() {

        return (
          <div>
            <h1>Maze</h1>
            <div className='maze'>
           {this.state.mazeMap.map((item, index) => {
              return item.map((cell, i) => {
                if (cell === 0) {
                  return <div className='cell path'>path</div>;
                } else {
                  return <div className='cell wall'>wall</div>;
                }
              });
            })}
          </div>
          </div>
        );
    }

}

export default Maze;
